INSERT INTO `mobileinfo` VALUES (1017, '诺基亚E72i（精锐导航版） ', '2300', '/cell_phone/index246168.shtml', 'index246168', 'http://2c.zol-img.com.cn/product/47_220x165/990/ce9AAVhmsdgUU.jpg', '有了行货E72后，诺基亚推出了性能更为全面的E72i，而后又推出了配件较为丰富的E72i导航版，然后诺基亚继续发布了这款E72i精锐导航版。让人一时间感到有些不知所措分不清这几款机型的区别。其实行货E72，E72i，E72i导航版，E72i精锐导航版，可以看作是一个循序渐进的版本衍生过程，一代比一代有所提升，但除了E72外，其他三款在性能方面没有太大的区别。', '8.1', '精锐导航版');
