INSERT INTO `mobileinfo` VALUES (1019, '诺基亚N97mini（黄金版） ', '4100', '/cell_phone/index232910.shtml', 'index232910', 'http://2c.zol-img.com.cn/product/55_220x165/838/ceBNIWkUjAIRk.jpg', 'N97 mini的三围仅仅是113×52.5×14.2毫米，长宽高三个数值相比于N97来说都有了明显的“缩水”，而138克的重量也比N97重达150克的大块头轻出了许多，看来“迷你”之意在N97 mini上体现得淋漓尽致。如果不论个头，单就手机正面的样式来看，N97 mini和N97几乎没有区别。屏幕上方依旧是光线感应器、前置摄像头+LED灯，不同的仅是此次摄像头和LED灯是纵向排列的。另外相信细心的网友会发现，在N97 mini上标刻得型号还是“N97”，看来N97 mini骨子里流的还是N97的血。', '7.2', '黄金版');
