INSERT INTO `mobileinfo` VALUES (1032, '诺基亚E72i（导航版） ', '2300', '/cell_phone/index241531.shtml', 'index241531', 'http://2c.zol-img.com.cn/product/45_220x165/826/ceNvsieBRuE56.jpg', '诺基亚E72的推出了迅速积累起来了超高的人气，但对于国内用户来说，行货版本的E72在诸多实用配置方面都被“阉割”，WCDMA和WIFI功能也无法得以实现。而后诺基亚趁热推出了水货E72的升级版，在变了一个名字之后就成了这款行货E72i，E72i和行货E72相比，3G和WIFI的功能都有配备，性能更加全面。而E72i导航版和E72i在配置上没有太大的区别，只是在配件内容上丰富一些。', '8.1', '导航版');
