INSERT INTO `mobileinfo` VALUES (1887, 'Moto V8 ', '1222', '/cell_phone/index108045.shtml', 'index108045', 'http://2b.zol-img.com.cn/product/45_220x165/161/ce0NC3cdNDOiE.jpg', '摩托罗拉V8采用了一块2.0英寸26万色的QVGA分辨率的外屏和一块2.2英寸26万色的QVGA分辨率的内屏，二者的显示效果均十分出色。内置了一枚200万像素的摄像头，在现在看来略微落伍，拍摄效果基本让人满意。此该机采用了Linux操作系统，配以主频为500MHz的处理器，运行效果还是非常出色的。', '7.3', '');
INSERT INTO `mobileinfo` VALUES (1888, '三星GALAXY Mega 5.8（I9158/移动3G） ', '1250', '/cell_phone/index356189.shtml', 'index356189', 'http://2f.zol-img.com.cn/product/114_220x165/437/ceUecmgsy4c.jpg', '移动定制机，5.8英寸超大屏幕，但是屏幕分辨率略低，单卡双模，需要剪卡，不支持关机闹钟', '7.5', 'I9158/移动3G');
INSERT INTO `mobileinfo` VALUES (1889, '诺基亚5230（世博版） ', '2080', '/cell_phone/index245308.shtml', 'index245308', 'http://2f.zol-img.com.cn/product/47_220x165/583/cecTcMWcMg7u2.jpg', '诺基亚5230绝对是目前最具性价比的S60第5版智能手机。支持换壳，整机娱乐能力突出，与诺基亚5800极为相似。0.5mm厚度的减少，以及相比5800XM增加的4克机重，基本可以忽略不计。不同于诺基亚5530XM的触控功能键设计，5230回归了传统的物理实体按键。尽管仅有3枚，但似乎更加符合大众的使用习惯。此外令人开心的是，5230虽然是简化过的5800XM，但仍然保留了对于3G网络的支持，而避免了5530直接降级到2G网络的尴尬。不过还是取消了前置摄像头的设计，WIFI功能也缺乏，不免有些遗憾，所幸是G', '7.8', '世博版');
