INSERT INTO `mobileinfo` VALUES (2172, '索尼爱立信X5（Pureness） ', '4180', '/cell_phone/index201430.shtml', 'index201430', 'http://2b.zol-img.com.cn/product/41_220x165/163/ceVobtGXv4Po.jpg', '索尼爱立信X5造价昂贵，所以笔者的每一个动作都相当小心。从盒子中小心翼翼地取出主机，环顾机身，一时间竟无法分辨其正反面。其实还是因为X5的屏幕是透明的，而且机器下半部分的两面都设计了按键，看来子在如此小的空间内集成如此多的功能还是不得不将按键合理地分散布局才行。可能是出于稳固与安全考虑，屏幕的侧面还是以较厚的塑料包围。这一方面能够维持机身上下两个部分色调的一致，不至于视觉上显得突兀；另一方面，也是对屏幕起到了很好的支撑作用。', '6.4', 'Pureness');
