INSERT INTO `mobileinfo` VALUES (2180, '索尼爱立信ST18i（Xperia ray） ', '1625', '/cell_phone/index281999.shtml', 'index281999', 'http://2b.zol-img.com.cn/product/64_220x165/735/ceOAhJzUUXJ16.jpg', '索尼爱立信Xperia ray ST18i拥有111x53x9.4mm的完美三围身段，就好像产品发布现场，来自日本和瑞典的产品设计师对ST18i的看法那样，它就是一部为“人”打造的手机，让你即便是一天24小时都把它拿在手里，都不会觉得累。之所以不会有累得感觉，是因为ST18i的9.4mm机身厚度，也是因为其53mm的机身宽度。从视频中大家就可以看得出，ST18i比普通手机要显得更为修长一些，再加上纤薄的机身、上乘的手感、及100g的整机重量，我们终于又看到了曾经的那个索尼爱立信。', '8.7', 'Xperia ray');
