INSERT INTO `mobileinfo` VALUES (2185, 'OPPO A520 ', '1398', '/cell_phone/index227972.shtml', 'index227972', 'http://2c.zol-img.com.cn/product/45_220x165/44/ce9DdnIEOQKo.jpg', '乍看之下，OPPO A520就是一部纯白配色的翻盖手机。但其实仔细观察，你会发现，透明的外壳下暗藏了隐蔽的水波纹路。使视觉与触觉产生了强烈的反差。机身背面与正面相比，要白得更加彻底。轻微的磨砂处理，淡淡的荧光涂层，连吊饰孔的设计也显得很有创意。另外一个亮点就是扬声器的造型。蝴蝶一样的形状，与“Ulike享自由”的产品线定位不无关联。同时，A520采用翻盖造型，也是一种蝴蝶般自由飞舞的象征。OPPO推出了多个系列，比如Ulike系列，比如Real系列等，不论从外观上还是从机身内的类似主题编辑器这样的功能上，', '7.3', '');
