INSERT INTO `mobileinfo` VALUES (2273, 'Moto XT701（里程碑） ', '1560', '/cell_phone/index223115.shtml', 'index223115', 'http://2f.zol-img.com.cn/product/46_220x165/761/ceGJSEnxGNMOY.jpg', '摩托罗拉XT701，我们看到又是一款非常经典的摩托罗拉式工业设计加上谷歌式操作体验的产品。外观和功能方面来看，摩托罗拉XT701更像是一款无字版的摩托罗拉里程碑，非对称设计极有韵味。充满金属味道的机身质感非凡，有效的避免了指纹缠身。屏幕方面与摩托罗拉XT702保持了一致，一块3.7英寸的FWVGA分辨率的电容屏显示效果清晰细腻，支持多点触控，让人爽心悦目。CPU依旧维持在XT702的水平，整机运行畅快。不喜欢摩托罗拉XT702的臃肿与庞大，则大可选择这款XT701。', '7.8', '里程碑');
