INSERT INTO `mobileinfo` VALUES (2280, '索尼爱立信E10i（X10mini） ', '800', '/cell_phone/index232506.shtml', 'index232506', 'http://2d.zol-img.com.cn/product/47_220x165/923/cegatcukchkk.jpg', 'X10mini与X10mini pro简直是像得一塌糊涂，正面除了听筒部分略微有点弧度的设计，同样都是2.55英寸的电容屏幕，并且配备了3枚物理按键。翻转手机，我们终于找到了两部手机的不同之处。虽然同为500万像素，且配备了LED闪光灯。值得一提的是，索尼爱立信都没有忘记“Xperia”的标识。其实笔者也有些奇怪，为什么X10 mini取消了QWERTY全键盘的设计，却没有得到更为轻薄的机身呢？身材是小了，但是厚度却只薄了1mm，这其中的原因在本文的最后会为大家揭晓。', '6.8', 'X10mini');
