INSERT INTO `mobileinfo` VALUES (2358, 'Moto XT702（里程碑） ', '680', '/cell_phone/index234082.shtml', 'index234082', 'http://2c.zol-img.com.cn/product/54_220x165/44/ce9Jl2N88wD9Q.jpg', '基本参数与摩托罗拉Milestone相一致，不过作为行货Milestone，摩托罗拉XT702在功能上没有太多的删减，主要是Google的相关服务被删减一些。外观上真正的区别在这里：行货版的XT702为了更加适应中国人的输入习惯在QWERTY键盘中将一个作用不大的按键更换为中英文切换键，这样的改动更加的适合中国人的使用习惯，这也是外观上XT702与Milestone的最大区别。功能方面，Android系统提供良好的平台支持，WIFI、GPS等功能也都具备，整体实力很强劲，摩托罗拉XT702的火爆意料之中。', '8.0', '里程碑');
