INSERT INTO `mobileinfo` VALUES (2463, '黑莓9550（Verizon） ', '1800', '/cell_phone/index187413.shtml', 'index187413', 'http://2a.zol-img.com.cn/product/53_220x165/556/ce5jMWL3t5U4g.jpg', '黑莓9550同样配备了3.25吋480×360分辨率的电容屏幕，并且也延用了对抗iPhone的“SurePress”技术，操作手感与9520持平。机顶的锁屏、静音隐藏键、LED指示灯以及光线感应器；金属质地的后盖以及开合方式两者也完全一致。在仔细将两者比较之后，才可以负责任地说，由于两款机器为不同的运营所定制，所以仅在机身的定制LOGO上有所不同。', '8.5', 'Verizon');
