INSERT INTO `mobileinfo` VALUES (2465, '中兴R750 ', '990', '/cell_phone/index246830.shtml', 'index246830', 'http://2d.zol-img.com.cn/product/47_220x165/83/cexnbUSql5RE.jpg', '用一个词形容中兴R750的话，就是“简约”，但这个“简约”却隐藏着一个小技巧。首先机身正面是一块3.2英寸的电容式触摸屏幕，分辨率达到HVGA、即320x480，并且在浏览网页的时候，我们也印证了它支持多点触控。屏幕左上方是一个天翼的LOGO，但并没有视频通话摄像头。紧挨屏幕靠下的，是三个感应式功能键，分别为Home、Menu、以及返回。至于标题所说的“不对称”，指的是最下面的轨迹球。它应该是首例没有设计在正中间的产品，并且通话挂机键的造型也是令人耳目一新的条形一体式，总体看上去很新颖。', '5.9', '');
