INSERT INTO `mobileinfo` VALUES (2491, '索尼爱立信U5i（Vivaz） ', '990', '/cell_phone/index218442.shtml', 'index218442', 'http://2b.zol-img.com.cn/product/45_220x165/569/ceWm615HCx1lU.jpg', '拿到产品的第一眼，笔者着实被吓了一跳。见过小包装的产品，但没见过如此精致的。送测的仅有一部裸机，外加一块电池，而所谓包装，不过是将手机放在一个“合身”的凹槽中。整体效果就像一本微缩字典一样。打开“字典”，手机的大致参数“历历在目”。包括内置810万像素摄像头，搭载3.2英寸屏幕，以及支持A-GPS，与WiFi无线上网。不过它们并不是U5i外观上的特点。', '7.1', 'Vivaz');
