INSERT INTO `mobileinfo` VALUES (2591, '诺基亚5250 ', '730', '/cell_phone/index250486.shtml', 'index250486', 'http://2f.zol-img.com.cn/product/51_220x165/295/ce7yV7LI7Jb0.jpg', '机身尺寸为105×50×14mm，重106g，虽然采用了大量的塑料材质，不过在机身顶端和底部都采用了钢琴烤漆装饰，背部磨砂质感。和5230一样，5250也有很多颜色，包括深灰色、蓝色、红色、白色和紫色。延续了XM系列的良好音乐品质，有自带的音乐播放器，支持MP3，AAC，eAAC，eAAC+以及WMA格式的音频文件，3.5mm标准耳机插孔；支持GSM 四频段的5250，不支持3G，也不支持Wi-Fi，可用内存51MB，是款S60V5入门智能触控手机产品。', '6.9', '');
INSERT INTO `mobileinfo` VALUES (2592, '三星I900（16GB） ', '950', '/cell_phone/index148404.shtml', 'index148404', 'http://2f.zol-img.com.cn/product/46_220x165/867/cevmm5fqNkz3Q.jpg', '三星i900采用了直板触屏设计，该机配置了一块3.2英寸TFT触屏，分辨率为240×400，显示效果不错。内置的500万像素的摄像头，支持自动对焦，还具有防抖和面部识别能力，成像效果不俗。该机搭载了Windows Mobile 6.1操作系统，配以624Mhz的处理器，128MB RAM+16GB ROM的组合，程序运行速度流畅。 此外，该机还配备了GPS导航和WiFi无线上网功能，表现非常全面。', '7.9', '16GB');
