INSERT INTO `mobileinfo` VALUES (2653, 'Moto ME600（黑金刚版） ', '1150', '/cell_phone/index240689.shtml', 'index240689', 'http://2a.zol-img.com.cn/product/45_220x165/20/cexzJkOFraGE.jpg', '摩托罗拉ME600是全球首款后空翻产品，采用一个独特的铰链来完成整个后空翻动作，整机的金属质感强烈，是摩托罗拉工业美学理念的完美体现。系统上面，摩托罗拉ME600搭载了Android系统，具有强大的扩展能力，核心硬件上也想到抢眼，整机的运行速度很流畅。后置了一枚500万像素的摄像头，成像能力突出。ME600针对中国用户特点也做了许多的优化，MOTOBLUR服务很贴心，整机的表现可圈可点。而且ME600在网络上很完善，支持WCDMA网络和GPS导航。', '7.8', '黑金刚版');
INSERT INTO `mobileinfo` VALUES (2654, '三星Galaxy Mini（I559） ', '560', '/cell_phone/index271791.shtml', 'index271791', 'http://2a.zol-img.com.cn/product/61_220x165/766/ceAFYvHYgcpNA.jpg', '三星 盖世 S5570是一款入门级智能手机，拥有迷人小巧的外形，以及多种时尚色款，与2010年非常火爆的酷毕系列有些相似。采用了目前主流的安卓2.2系统，TouchWiz操作界面，配备一块3.14英寸QVGA 分辨率多点触控屏幕，主频为600MHz处置器，另外300W像素摄像头，并不支持自动对焦功能，配置可圈可点。此外，A-GPS蓝牙以及Wi-Fi功能同样齐备，依然采用了最为常用的microUSB数据接口和3.5毫米耳机接口。', '7.2', 'I559');
