INSERT INTO `mobileinfo` VALUES (2843, 'Moto Milestone（里程碑） ', '1520', '/cell_phone/index217980.shtml', 'index217980', 'http://2a.zol-img.com.cn/product/55_220x165/376/ceMcoIbqD5Cpw.jpg', 'Milestone是一款性价比非产高的产品，采用了全新的Android2.0操作系统，并且搭配了经典的摩托罗拉工业设计，整机非常的出色。屏幕尺寸达到了3.7英寸，分辨率高达480×854像素，显示效果清晰锐利，并且支持多点触控。Milestone金属质感强烈，也能够有些的防滑和避免指纹。Android系统的扩展能力强大，硬件性能主流，支持图形加速器，各项表现颇为霸道。这款Milestone是摩托罗拉重回第一阵营的扛鼎之作，实力非同一般。', '8.8', '里程碑');
