INSERT INTO `mobileinfo` VALUES (2860, 'OPPO X903（Find） ', '2498', '/cell_phone/index283830.shtml', 'index283830', 'http://2c.zol-img.com.cn/product/67_220x165/128/ceHRoRkHMKcAg.jpg', 'OPPO X903拥有一块4.0英寸的IPS电容触摸屏幕（该屏幕由日本日立公司提供），分辨率WVGA（480x800），支持10点触控操作。屏幕下方为四个标准Android功能按键，点触伴随震动反馈，手感恰到好处。屏幕上方为条状听筒，整个机身正面采用金属拉丝工艺，视觉颇具质感。侧滑全键盘为四排样式，带有独立的方向键区，以及中英文切换键，不过按键手感一般，键程稍短，顶部一排由于相对靠近上滑盖，所以需要竖起手指才能操作（侧滑盖具备单独开合音效，可手动关闭）。', '6.8', 'Find');
